import React from "react";
import CartIcon from "./cartIcon";
import classes from './HeaderButton.module.css'
const HeaderButton = ()=>{
    <button >
       <span className={classes.icon}><CartIcon/></span> 
       <span>Your Cart</span>
       <span className={classes.badge}>
        3
       </span>
       <span></span>
    </button>
}

export default HeaderButton;
